// void merge (int *a, int n, int m) {
void merge (JSON *a, JSON *n, JSON *m) {
    // int i, j, k;
    JSON *i = json_create_number(0);
    JSON *j = json_create_number(0);
    JSON *k = json_create_number(0);
    // int *x = malloc(n * sizeof (int));
    JSON **array = (JSON **)malloc(json_as_number(n) * sizeof (JSON *));
    for (JSON *it = json_create_number(0); json_lesser_than(it, n); json_increment(it)) {
        array[json_as_number(it)] = json_create_number(0);
    }
    JSON *x = json_create_vector(array, json_as_number(n));
    // for (i = 0, j = m, k = 0; k < n; k++) {
    for (json_assignment(j, m); json_lesser_than(k,n); json_increment(k)){
        // x[k] = j == n      ? a[i++]
        //      : i == m      ? a[j++]
        //      : a[j] < a[i] ? a[j++]
        //      :               a[i++];
        JSON * new_value = json_equals(j,n)? json_array_get(a, json_as_number(json_increment(i))) 
                : json_equals(i,m)? json_array_get(a,  json_as_number(json_increment(j)))
                : json_lesser_than(json_array_get(a,json_as_number(j)), json_array_get(a,json_as_number(i)))? json_array_get(a,  json_as_number(json_increment(j)))
                : json_array_get(a,  json_as_number(json_increment(i)));
        json_array_set(x, json_as_number(k), new_value);
    }
    // for (i = 0; i < n; i++) {
    for (json_assignment(i, json_create_number(0)); json_lesser_than(i, n); json_increment(i)) {
        // a[i] = x[i];
        json_array_set(a, json_as_number(i), json_array_get(x, json_as_number(i)));
    }
    for (JSON * m = json_create_size(0); json_lesser_than(m,n); json_increment(m)) {
            free(json_array_get(x, json_as_size(m)));
    }
    free(x);
    free(array);
}

