void mergesort (JSON *a, JSON* n) {
    // if (n < 2)
        // return;
    if (json_lesser_than(n, json_create_number(2)))
        return;
    
    // int m = n / 2;
    JSON* m = json_div_numbers(n, json_create_number(2));
    mergesort(a, m);
    // mergesort(a + m, n - m);
    mergesort(json_add_numbers(a, m), json_sub_numbers(n, m));
    merge(a, n, m);
}

